// Dashboard.js
import React, { useState } from "react";
import { Navbar, Footer } from "./CommonUI";

const Dashboard = () => {
  const [isDarkMode, setIsDarkMode] = useState(false);
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const toggleDarkMode = () => setIsDarkMode(!isDarkMode);
  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);

  return (
    <div
      style={{
        fontFamily: "'Poppins', sans-serif",
        minHeight: "100vh",
        display: "flex",
        flexDirection: "column",
        backgroundColor: isDarkMode ? "#121212" : "#F4F7F4",
        color: isDarkMode ? "#f1f1f1" : "#222",
        transition: "all 0.3s",
      }}
    >
      {/* Navbar */}
      <Navbar
        isDarkMode={isDarkMode}
        toggleDarkMode={toggleDarkMode}
        isLoggedIn={true}
      />

      {/* Main Dashboard Area */}
      <div style={{ display: "flex", flex: 1 }}>
        {/* Sidebar */}
        <div
          style={{
            width: sidebarOpen ? "250px" : "50px",
            backgroundColor: isDarkMode ? "#1E1E1E" : "#0B3D02",
            color: "white",
            transition: "width 0.3s",
            padding: "20px 10px",
            display: "flex",
            flexDirection: "column",
            alignItems: sidebarOpen ? "flex-start" : "center",
            borderRight: isDarkMode ? "1px solid #333" : "1px solid #145A32",
          }}
        >
          <button
            onClick={toggleSidebar}
            style={{
              backgroundColor: sidebarOpen
                ? "#145A32"
                : isDarkMode
                ? "#333"
                : "#145A32",
              color: "white",
              border: "none",
              padding: "8px",
              borderRadius: "5px",
              cursor: "pointer",
              marginBottom: "20px",
              width: sidebarOpen ? "100%" : "40px",
              transition: "all 0.3s",
            }}
          >
            {sidebarOpen ? "Close" : "≡"}
          </button>

          {sidebarOpen && (
            <div style={{ marginTop: "20px" }}>
              <div style={{ marginBottom: "15px", fontWeight: "bold" }}>
                Profile
              </div>
              <div style={{ marginBottom: "10px" }}>
                <strong>Name:</strong> John Doe
              </div>
              <div style={{ marginBottom: "10px" }}>
                <strong>Email:</strong> john.doe@example.com
              </div>
              <div style={{ marginBottom: "10px" }}>
                <strong>Role:</strong> Student
              </div>
            </div>
          )}
        </div>

        {/* Dashboard Main Content */}
        <div
          style={{
            flex: 1,
            padding: "30px",
            backgroundColor: isDarkMode ? "#222" : "#F4F7F4",
            transition: "all 0.3s",
          }}
        >
          <h2>Welcome to Your Dashboard</h2>
          <p>
            Here you can access your practice sets, track your progress, and
            manage your profile.
          </p>

          {/* Example content cards */}
          <div style={{ display: "flex", gap: "20px", flexWrap: "wrap" }}>
            <div
              style={{
                backgroundColor: isDarkMode ? "#145A32" : "#1E8449",
                padding: "20px",
                borderRadius: "10px",
                color: "white",
                width: "200px",
                textAlign: "center",
              }}
            >
              Practice Sets
            </div>
            <div
              style={{
                backgroundColor: isDarkMode ? "#145A32" : "#1E8449",
                padding: "20px",
                borderRadius: "10px",
                color: "white",
                width: "200px",
                textAlign: "center",
              }}
            >
              Progress Tracker
            </div>
            <div
              style={{
                backgroundColor: isDarkMode ? "#145A32" : "#1E8449",
                padding: "20px",
                borderRadius: "10px",
                color: "white",
                width: "200px",
                textAlign: "center",
              }}
            >
              Notifications
            </div>
          </div>
        </div>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default Dashboard;
